INSERT INTO `EstudoPreliminar` (`id`, `contratacoes_correlatas`, `declaracao_viabilidade`, `descricao_solucao`, `estimativa_quantidades`, `justificativa_parcelamento`, `levantamento_mercado`, `metodo_estimativa_preco`, `necessidade_contratacao`, `providencias_adequacao`, `ref_outros_instrumentos`, `requisitos_contratacao`, `resultados_pretendidos`, `grupo_id`, `item_id`) VALUES
(1, '', 'sdsd', '', 'A estimativa da quantidade de material a ser adquirido tem por base o levantamento de fluxo de saída do almoxarifado do IFPI/CAPAU, levantamento esse realizado por meio do SUAP - Sistema Unificado de Administração Pública - o qual deu suporte a Coordenação de Patrimônio e Almoxarifado, por meio da emissão de relatórios.', 'sdsds', 'O levantamento de mercado ocorreu por meio do Painel de Preços, o qual é objeto preferencial na contratações pública, segundo a IN nº 03/2017 do MPDG, podendo ainda ser utilizado o Banco de Preço e as pesquisa locais como complemento, a fim de formar a chamada \"cesta de preços\".', 'sdsds', 'Necessidade de ressuprimento dos estoques de almoxarifado para o exercício de 2020, considerando que o saldo ora existente tem um alto fluxo de rotatividade, haja vista se tratar de uma Escola Federal de Ensino. O Material de expediente é de fundamental importância para as rotinas diárias, assim compete ao IFPI/CAPAU a aquisição dos itens. Optando-se pelo sistema de Registro de Preço busca-se a gestão eficiente do estoque por meio do sistema muito próximo ao just in time, haja vista que a aquisição dos objetos será realizada somente para atender ao ressuprimento necessário assim que os materiais em estoque se encontrarem no nível mais baixo possível, mas dentro dos níveis de segurança para atender a demanda do Instituto Federal do Piauí/Campus Paulistana.', '', 'Não há instrumento de planejamento que norteie esses estudos.', '  ', '', 1, NULL),
(12, '', 'A contratação dos produtos é plenamente viável, visto que os objetos de contratação possuem ampla disponibilidade no mercado.', '', 'As quantidades foram estimadas com base nas aquisições e efetivo uso durante os anos anteriores.', 'A entrega dos produtos deverá ser parcelada, de acordo com a demanda, visto que se tratam de gêneros alimentícios que possuem prazo de validade para sua utilização e também devido à pequena capacidade de armazenamento dos produtos  no órgão.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública.', 'Fornecimento de refeições aos discentes do IFPI -  campus Paulistana.', '', '', '', '', 8, NULL),
(13, '', 'Contratação viável.', '', 'Capacitação \r\n valor unitário $2.900,00\r\nvalor total estimado : 5.800,00\r\n02 servidores \r\nValor cobrado pela Empresa ESAFI\r\nhttp://www.esafi.com.br/curso/retencoes-de-tributos-na-administracao-publica-efd-reinf-e-dctfweb-e-novas-declaracoes-acessorias-do-sped-26092018-28092018/', 'Não parcelamento do objeto.', '', '$5.800,00 para 02 servidores \r\nMédia realizada através de pesquisas feitas pelas empresas prestadoras de serviços de treinamento/capacitação na área de interesse - contábil.', 'Diante da dificuldade de realizar atividades de retenções tributárias nas variadas atividades(notas fiscais de serviços continuados, aquisição de produtos com isenção de alguns tributos, empresas filantrópicas, cooperativas, agricultura familiar) que surgem na prática contábil do Setor, é de fundamental necessidade e urgência a capacitação dos servidores .', '', '', '', '', NULL, 80),
(14, '', 'Contratação viável', '', 'Valor Unitário - $2.000,00, Valor Total - 4.000,00 ; http://www.abop.org.br/index.php?option=com_content&view=article&id=182:iii-curso-de-gestao-patrimonial&catid=38&Itemid=95 - ABOP - empresa que fornece o curso.', 'Não parcelado', '', '4.000,00 para 02 servidores;  Média realizada através de pesquisas feitas pelas empresas prestadoras de serviços de treinamento/capacitação na área de interesse - contábil.', 'Diante da obrigatoriedade de realizar os procedimentos patrimoniais da depreciação, amortização, exaustão e reavaliação dos bens na Administração Pública é de fundamental relevância que as servidoras do Setor Contábil ( Francisca Aldemara Alves Batista e Bruna Nunes Brasilino ) participem de capacitação na área de modo a instruí-las da legislação vigente, bem com de suas práticas. ', '', '', '', '', NULL, 81),
(15, '', 'Através da elaboração dos Estudos Técnicos Preliminares pela Equipe Técnica de Planejamento de Contratação.', '', 'A estimativa de quantidade tem por base as demandas do setor. ', 'Considerando a natureza dos bens e a precisão quanto ao quantitativo necessário, a entrega deverá ser em remessa única.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'O laboratório de mineração apresenta um deficit em recursos materiais e muitas atividades deixam de ser realizadas por esse motivo. A aquisição desses materiais são essenciais para o armazenamento, acomodação e manuseio de matérias brutas e/ou processadas.', '', '', '', '', 9, NULL),
(16, '', 'A contratação é viável para que os problemas sejam sanados', '', 'As estimativas basear-se-ão nas quantidades adquiridas anteriormente, fazendo uma média aritmética das últimas aquisições, acrescentando 20% onde for cabível.', 'Não há justificativa', '', 'O site do Painel de Preços do Ministério do Planejamento, Desenvolvimento e Gestão', 'A contratação se faz necessária para manutenção tanto preventiva quanto corretiva do imóvel.  ', '', '', '', '', 11, NULL),
(17, '', 'JSGYFUYBFVYUGBFVUKY', '', 'KSDUGFYUDSBVIUSDVB', 'JKSGFVBYUSVBBYUSDVUI', '', 'JYGSUBYSDVYDSBVGSJ', 'GFVBSDVBIUSDBVIB', '', '', '', '', 13, NULL),
(18, '', 'Através da elaboração dos Estudos Técnicos Preliminares pela Equipe Técnica de Planejamento de Contratação.', '', 'A estimativa de quantidade tem por base as demandas dos cursos técnico em mineração e agropecuária e bacharelado em zootecnia .', 'Considerando a natureza dos bens e a precisão quanto ao quantitativo necessário, a entrega deverá ser em remessa única.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'O laboratório de mineração apresenta um deficit em recursos materiais e muitas atividades deixam de ser realizadas por esse motivo. A aquisição desses materiais são essenciais para as atividades práticas em topografia e na execução de projetos de extensão.', '', '', '', '', 14, NULL),
(19, '', 'Laboratório de informática com a estrutura adequada para o desenvolvimento  das atividades relacionada ao software, além de ser uma ferramenta utilizada basicamente na grandes empresas do ramo da mineração.', '', 'De acordo com a demanda do curso e quantidade de computadores disponíveis', 'Parcela única', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'Melhor preparação do discente para o mercado de trabalho', '', '', '', '', 15, NULL),
(20, '', 'A viabilidade dependerá dos valores orçamentários disponíveis. Logo, estarão a cargo da administração ', '', 'A estimativa de quantidades foi levantada de acordo com a quantidade de alunos no campus, bem como, levando em consideração a estrutura física dos laboratórios de informática.', 'Poderá ser parcela a aquisição de alguns itens caso não seja possível aquisição total do quantitativo estimado ', '', 'Destaco que as consultas de preço foram realizadas por meio de busca na internet levando em consideração as descrições dos materiais', 'Se faz necessária a aquisição dos materiais de informática visto que, são essenciais para que os discentes possam realizar práticas em laboratório. Esses materiais irão subsidiar o ensino e aprendizagem dos discentes não só numa perspectiva teórica mas também com uma abordagem prática, aproximada da realidade vivenciada por profissionais da área.  ', '', '', '', '', 16, NULL),
(21, '', 'É viável considerando aos riscos a que estamos expostos ', '', 'A estimativa de quantidade tem por base as demandas do setor.', 'Considerando a natureza dos itens e a precisão quanto ao quantitativo necessário, a entrega deverá ser em remessa única.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'O desempenho de algumas atividades expõe os usuários/operadores a riscos que podem ser sanados ou minimizados com o devido uso de equipamento de proteção.', '', '', '', '', 17, NULL),
(22, '', 'É viável considerando os diversos equipamentos do Campus passíveis de manutenção, necessidade de funcionamento e  utilizações diversas. ', '', 'A estimativa de quantidade tem por base as demandas do setor.', 'Considerando a natureza dos itens e a precisão quanto ao quantitativo necessário, a entrega deverá ser em remessa única.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'Para uso em manutenções e/ou adequação de funcionamento de equipamentos.', '', '', '', '', 18, NULL),
(23, '', 'É viável devido a carência dos itens no setor', '', 'A estimativa de quantidade tem por base as demandas do setor.', 'Considerando a natureza dos itens e a precisão quanto ao quantitativo necessário, a entrega deverá ser em remessa única.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'O laboratório de mineração apresenta um deficit em recursos materiais e muitas atividades deixam de ser realizadas ou são realizadas de forma inadequada por esse motivo. A aquisição desses materiais/equipamentos são essenciais para o bom desenvolvimento das atividades laboratoriais, o que contribui para o processo ensino/aprendizagem.', '', '', '', '', 19, NULL),
(24, '', 'É viável devido a carência dos itens no setor', '', 'A estimativa de quantidade tem por base as demandas do setor.', 'Considerando a natureza dos itens e a precisão quanto ao quantitativo necessário, a entrega deverá ser em remessa única.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'Os laboratórios apresentam um deficit em recursos materiais e muitas atividades deixam de ser realizadas ou são realizadas de forma inadequada por esse motivo. A aquisição desses materiais/equipamentos são essenciais para o bom desenvolvimento das atividades laboratoriais, o que contribui para o processo ensino/aprendizagem.', '', '', '', '', 20, NULL),
(25, '', 'É viável para as viagens', '', 'Site do Compras Governamentais, Painel de Preços e quantidades anteriores', 'Não há.', '', 'Média aritmética', 'Manter os veículos em bom funcionamento', '', '', '', '', 21, NULL),
(26, '', 'É viável.', '', 'Média aritmética através do histórico no SUAP.', 'Não há.', '', ' Painel de Preços.', 'Indispensável para o funcionamento da rede elétrica', '', '', '', '', 22, NULL),
(27, '', 'Viável de acordo com a necessidade do setor', '', 'Demandas do setor', 'Parcela única', '', 'Tabela de preços ou ainda Utilização do Painel de Preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para tomada de preço praticáveis pela Administração Pública ou pesquisa realizada com fornecedores, chegando-se ao preço médio por item.', 'Uma realidade cada vez mais tecnológica exige de quaisquer profissionais competências modernas, necessidade constante de aprimoramento e\r\naquisição de novas aprendizagens. A capacitação do servidor não só atende às necessidades do serviço, mas também a sua promoção pessoal. Seu aprimoramento permite que o servidor assuma novos desafios, projetando-se no seu ambiente de trabalho pelo seu desempenho, que proporcionará resultados positivos na\r\ninstituição pública em que atua. Além do mais, a utilização de alguns equipamentos, exigem capacitação tanto para manuseio, como para a instalação do mesmo, para que se evite problemas de desgastes, quebras indevidas ou até mesmo acidentes.', '', '', '', '', 23, NULL),
(28, '', 'Viável pois é necessária tal adaptação tendo em vista as condições de trabalho do setor', '', 'Necessidade do setor', 'Parcela única', '', 'Estimativa de mercado e/ou pesquisa de preço', 'Adaptação de salas para o adequado funcionamento do laboratório de mineração tendo em vista o layout incompatível às condições de trabalhos necessárias a os servidores do laboratório e pela grande quantidade de equipamentos ociosos por falta de espaço.', '', '', '', '', NULL, 375),
(29, '', 'É viável a contração da lista que segue no grupo, tendo em vista, a realização do evento.', '', 'Baseado nas quantidades previstas para os eventos anteriores.', 'Sem necessidade. A critério do Departamento de Administração.', '', 'Painel de Preços', 'A solicitação justifica-se pela necessidade de realização de Evento Institucional, por ocasião dos cursos  Técnico Integrado e Subsequente em Administração.\r\n ', '', '', '', '', 24, NULL),
(30, '', 'A contratação é viável, visto que os objetos de contratação estão amplamente disponíveis no mercado para aquisição e em preços praticáveis pela Administração Pública.', '', 'A quantidade de itens solicitados, tem como base as atividades  que são realizadas diariamente, a capacidade de utilização e de armazenamento dos mesmos pela unidade de alimentação e nutrição.', 'Os produtos serão adquiridos de acordo com a demanda do setor. Podendo ser parceladas ou não, de acordo com a necessidade de cada material.', '', 'Utilização do Painel de Preços, do Ministério do Planejamento, desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para a tomada de preços praticáveis pela Administração Pública.', 'Os materiais serão utilizados para auxiliar no processo de produção das refeições ofertadas pela unidade de alimentação e nutrição.', 'Dada a alta rotatividade, necessidade de substituição não-programável e devendo por isso existir utensílios de reserva disponíveis para que não haja prejuízo às atividades, é necessário que haja ampliação dos espaços destinados ao armazenamento provisório destes utensílios.', '', '', '', 25, NULL),
(31, 'Deverão ser contratados equipamentos que possuam assistência técnica disponível e formalização de contrato de manutenção corretiva e preventiva periódica.', 'A contratação é viável, visto que os objetos de contratação estão amplamente disponíveis no mercado para a aquisição e em preços praticáveis pela Administração Pública.', '', 'A quantidade de itens solicitados, tem como base as atividades realizadas diariamente, a necessidade de melhorias funcionais, a capacidade técnica de operação e de alocação dos mesmos dentro da estrutura da unidade de alimentação e nutrição.', 'A entrega dos produtos será de acordo com a demanda do setor.', '', 'Utilização do painel de preços, do Ministério do Planejamento, Desenvolvimento e Gestão, para acompanhamento das compras governamentais, por ser o meio preferencial para a tomada de preços praticáveis pela Administração Pública.', 'Os equipamentos  serão utilizados no processo de produção das refeições ofertadas pela unidade de alimentação e nutrição.', 'O orgão deverá buscar melhorias no sistema de fornecimento de energia, dada a alta quantidade de equipamentos elétricos que deverão ser ligados à rede.', '', '', '', 26, NULL),
(33, '', 'É viável a aquisição dos bens requeridos, visto que existem empresas especializadas no fornecimento dos itens e inclusive, já foi feito pesquisa de preços comprovando a disponibilidade.', '', 'O quantitativo para os itens do grupo em questão, leva em consideração o número de alunos e o período de execução das atividades que compreende um prazo de dois anos, para que não acarrete prejuízos a aprendizagem. ', 'Entrega do material parcelada para cada 6 meses, visto que alguns dos itens possuem prazo de validade. Também pela dificuldade em ter disponibilidade de local para armazenamento. ', '', 'Pesquisas de preços realizadas em empresas fornecedoras especializadas na área de materiais artísticos ou que apresentam os itens a serem adquiridos.', 'Compreende a compra de materiais fundamentais para o bom desenvolvimento da disciplina de arte e manutenção do espaço de pesquisa em artes, nesse caso, o laboratório de artes do campus Paulistana.', '', '', '', '', 28, NULL),
(34, '', 'Faz-se viável a aquisição dos bens requeridos, visto que existem empresas especializadas no mercado  para  fornecimento dos  instrumentos musicais solicitados.', '', 'Os quantitativos para os itens deste grupo leva em consideração o número de alunos e o período de execução de dois anos, para que não acarrete prejuízos para a aprendizagem musical do alunado', 'Entrega única', '', 'Pesquisa de preço averiguadas com empresas fornecedoras de materiais da área e que disponham de materiais musicais  para fornecimento', 'Necessidade de aquisição de instrumentos musicais para melhor funcionamento do laboratório de música, que engloba as aulas e pesquisas em música.', '', '', '', '', 29, NULL),
(35, '', 'É viável a aquisição dos bens requeridos, visto que existem empresas especializadas no fornecimento dos itens e inclusive, já foi feito pesquisa de preços comprovando a disponibilidade.', '', 'O quantitativo para os itens do grupo em questão, leva em consideração o número de alunos e o período de execução das atividades que compreende um prazo de dois anos, para que não acarrete prejuízos a aprendizagem.', 'Entrega do material parcelada para cada 6 meses, visto que alguns dos itens possuem prazo de validade. Também pela dificuldade em ter disponibilidade de local para armazenamento.', '', 'Pesquisas de preços realizadas em empresas fornecedoras especializadas na área de materiais artísticos ou que apresentam os itens a serem adquiridos.', 'Projeto destinado à ações de estudos do grafite com a comunidade estudantil do campus Paulistana. A ser executado tanto dentro da instituição como na comunidade em ações de extensão.', '', '', '', '', 27, NULL),
(36, '', 'É viável a aquisição dos bens e serviços requeridos, visto que existem empresas especializadas no fornecimento dos itens e inclusive, já foi realizado uma edição do evento, comprovando ser exequível e eficaz para a comunidade interna e externa.', '', 'O quantitativo para os itens do grupo em questão, leva em consideração o número de alunos envolvidos e público externo participante, bem como o período de execução das atividades que compreende um prazo de dois anos.', 'Entrega e prestação de serviço única.', '', 'Pesquisas de preços realizadas em empresas fornecedoras especializadas na área ou que apresentam os itens e serviços a serem adquiridos.', 'O evento destina-se a execução de ações artístico-culturais na comunidade, contemplando através da extensão a população local com atividades que envolvem as áreas de Música, Teatro, Dança e Artes Visuais com mostras, apresentações e oficinas artísticas por meio da atuação de alunos da instituição.', '', '', '', '', 30, NULL),
(37, '', 'É viável a aquisição dos bens e serviços requeridos, visto que existem empresas especializadas no fornecimento dos itens. Trata-se de uma necessidade observada que irá atender a toda a comunidade local.', '', 'O quantitativo para os itens do grupo em questão, leva em consideração o número de alunos envolvidos e público externo participante, bem como o período de execução das atividades que compreende um prazo de dois anos', 'Entrega e prestação de serviço única.', '', 'Pesquisas de preços realizadas em empresas fornecedoras especializadas na área ou que apresentam os itens e serviços a serem adquiridos.', 'O evento destina-se a execução de ações artístico-culturais com os alunos da instituição, contemplando através da extensão a comunidade interna e a população local com atividades que envolvem as áreas de Música, Teatro, Dança e Artes Visuais. Com  programações que contemplam mostras, apresentações e oficinas artísticas, assim como momentos de discussão com mesas redondas e palestras sobre as formas de percepção e pensar as artes. Tratando-se de um momento de pesquisas teóricas e práticas na área.', '', '', '', '', 31, NULL),
(38, '', 'É viável a aquisição dos bens e serviços requeridos, visto que existem empresas especializadas no fornecimento dos itens e inclusive, o núcleo encontra-se em atividade, comprovando ser exequível e eficaz para a comunidade interna e externa.', '', 'O quantitativo para os itens do grupo em questão, leva em consideração o número de alunos envolvidos e público externo participante, bem como o período de execução das atividades que compreende um prazo de dois anos.', 'Entrega e prestação de serviço única.', '', 'Pesquisas de preços realizadas em empresas fornecedoras especializadas na área ou que apresentam os itens e serviços a serem adquiridos.', 'Núcleo destinado a pesquisa em arte nas diversas modalidades artísticas e abordagem teorico-prática com alunos da instituição e comunidade externa.', '', '', '', '', 32, NULL),
(39, '', 'A aquisição dos bens e serviços solicitados é viável, uma vez que existem empresas que trabalham no fornecimento dos mesmos. Já houve evento similar realizado pelo NEABI, comprovando a viabilidade e importância do mesmo.\r\n', '', 'Estima-se a participação de 200 pessoas no evento, entre membros da comunidade interna e externa.', 'Não há.', '', 'Baseado no site indicado pelo campus.', 'O Mês da Consciência Negra é parte do calendário Institucional do Campus e visa ser um ambiente Científico, Filosófico, Sociológico, relacionado à Sabedoria popular, de modo que permita o debate sobre a resistência, luta, conquistas e desafios do povo negro no Brasil.', '', '', '', '', 33, NULL),
(40, 'Contratação de serviço de treinamento e manutenção do sistema ', 'A contração do serviço de treinamento deve ser realizado no momento da aquisição do produto', '', '01', 'Não parcelado', 'Foi realizado um  levantamento e identificou-se que apenas a Empresa BIBLIOTHECA  fornece o produto com as características desejadas ', 'Pesquisa de preço junto  a empresa BIBLIOTHECA', 'O sistema antifurto permite a prevenção de perdas de materiais bibliográficos, atua como sistema de proteção de acervos', 'Reforma da biblioteca incluindo a mudança da porta de entrada e reforma do teto pois há goteiras ', '', 'Dispensa de licitação ', 'Espera-se que o produto possa atender as demandas da biblioteca no que se refere ao  processo de segurança e prevenção de furtos de livros', 34, NULL),
(41, '', '___________________', '', '______________________', '________________________', '', '___________________________', 'Tendo em vista o caráter teórico prático da disciplina Educação física no IFPI ? Campus do  Paulistana Piauí, faz-se necessário a aquisição de materiais desportivos que não se encontra no referido campos, para a aprendizagem significativa dos alunos, vivências práticas, e execução de gestos desportivos referentes aos desportos coletivos e atividades físicas com foco na saúde e desempenho.', '', '', '', '', 36, NULL),
(43, '-------', '--------', '-------', '------', '------', '------', '------', 'Tendo em vista o caráter teórico prático da disciplina Educação física no IFPI ? Campus Paulistana, faz-se necessário a aquisição de materiais desportivos para a aprendizagem significativa dos alunos, vivências práticas, e execução de gestos desportivos referentes aos desportos coletivos e atividades físicas com foco na saúde e desempenho', '------', '------', '------', '------', NULL, 509),
(45, '', 'Viável.', '', 'Baseado nas demandas futuras das disciplinas da área de produção animal.', 'Não há.', '', 'Não há.', 'Material necessário para manejo de animais nas aulas de bovinocultura.', '', '', '', '', 37, NULL);
INSERT INTO `GerenciamentoRisco` (`id`, `acao_contingencia`, `acao_preventiva`, `descricao`, `impacto`, `probabilidade`, `responsavel_acao_contingencia`, `responsavel_acao_preventiva`, `grupo_id`, `item_id`) VALUES
(9, 'Manter estoque mínimo de segurança e manter contato com os fornecedores para saber o status de chegada dos produtos.', 'Realização de consulta prévia, junto aos fornecedores, sobre os prazos necessários para a entrega dos produtos e solicitar os mesmos dentro do cronograma previamente estabelecido.', 'Atrasos nas entregas', 'Alto', 'Alta', 'Nutricionista', 'Nutricionista', 8, NULL),
(10, 'Devolução imediata, no ato do recebimento, dos produtos que não se adequem ao padrão exigido nos termos da contratação.', 'Definir, através dos termos de referência dos editais de contratação, os padrões obrigatórios e  condicionantes para recebimento dos produtos.', 'Inadequação aos padrões de qualidade exigidos', 'Alto', 'Alta', 'Nutricionista', 'Nutricionista', 8, NULL),
(11, 'Tentar realocar  uma nova data para a participação no evento, de forma que não ocorram tantos prejuízos.', 'Sair com antecedência do local de origem para que os imprevistos não ocasionem prejuízos.', 'Perder o voo', 'Alto', 'Baixa', 'Francisca Aldemara Alves e Batista', 'Francisca Aldemara Alves Batista e Bruna Nunes Brasilino', NULL, 80),
(12, 'Tentar realocar  uma nova data para a participação no evento, de forma que não ocorram tantos prejuízos.', 'Sair com antecedência do local de origem para que os imprevistos não ocasionem prejuízos.', 'Perder voo', 'Alto', 'Baixa', 'Francisca Aldemara Alves Batista e Bruna Nunes Brasilino', 'Francisca Aldemara Alves Batista e Bruna Nunes Brasilino', NULL, 81),
(13, 'utilização de simuladores  para tentar se aproximar da utilização prática ', 'Solicitação dos materiais junto a  direção com justificativa da demanda', 'Não recebimento dos materiais', 'Alto', 'Média', 'Todos os professores do curso', 'werney Ayala Luz Lira', 16, NULL),
(14, 'utilização de simuladores  para tentar se aproximar da utilização prática ', 'Solicitação dos materiais junto a  direção com justificativa da demanda', 'Não recebimento dos materiais', 'Alto', 'Média', 'Todos os professores do curso', 'werney Ayala Luz Lira', 16, NULL),
(15, 'Conferir o produto no ato do recebimento e devolver, caso o produto não atenda as especificações exigidas.', 'Descrever corretamente os padrões desejados para o produto. ', 'Inadequação aos padrões desejados e especificados nos documentos e/ou qualquer etapa do ato licitatório', 'Alto', 'Média', 'Nutricionista', 'Nutricionista', 25, NULL),
(16, 'Devolução dos itens que estiverem em desacordo com os padrões especificados.', 'Descrever adequadamente todas os padrões necessárias para a aquisição dos itens.', 'Inadequação aos padrões desejados e  especificados nas etapas e documentos do ato licitatório', 'Alto', 'Média', 'Nutricionista', 'Nutricionista', 26, NULL),
(19, 'Notificar a empresa fornecedora e solicitar que ela seja penalizada caso não entregue os itens e prosseguir com o processo de contratação da segunda colocada no pregão.', 'Informar a empresa da necessidade dos materiais, estipular prazo hábil para a entrega e acompanhar os tramites de contratação.', 'Não entrega do material.', 'Alto', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 28, NULL),
(20, 'notificar a empresa fornecedora e solicitar que a empresa fornecedora seja penalizada caso não enregue os itens e prosseguir com o processo de contratação da segunda colocada no pregão', 'Verificar com a empresa quais novo prazos para entrega de materiais; estipular prazo hábil para entrega e acompanhar os tramites de contratação', 'Não entrega do material solicitado', 'Alto', 'Baixa', 'Rodrigo Alves de Melo', 'Rodrigo Alves de Melo', 29, NULL),
(21, 'Notificar a empresa fornecedora e solicitar que a empresa  seja penalizada caso não entregue o novo produto e prosseguir com a segunda colocada no pregão.', 'Verificar com a empresa quais novos prazos para troca e nova entrega de materiais; estipular prazo hábil para nova  entrega ', 'Entrega de produto com defeito', 'Alto', 'Baixa', 'Rodrigo Alves de Melo', 'Rodrigo Alves de Melo', 29, NULL),
(22, 'Notificar a empresa fornecedora, solicitar a troca dos itens e caso a  empresa não cumpra, solicitar que ela seja penalizada e prosseguir com o processo de contratação da segunda colocada no pregão.', 'Informar a empresa da necessidade dos prazos dos materiais estarem com a validade em ordem, estipular prazo hábil para a entrega e acompanhar os tramites de contratação.', 'Entrega de materiais com prazo de validade vencido.', 'Médio', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 28, NULL),
(23, 'Notificar a empresa fornecedora e solicitar que ela seja penalizada, caso não entregue o novo produto e prosseguir com a segunda colocada no pregão.', 'Verificar com a empresa novos prazos para troca e nova entrega de materiais.', 'Entrega de produtos com defeito.', 'Alto', 'Média', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 28, NULL),
(24, 'Notificar a empresa fornecedora e solicitar que ela seja penalizada caso não entregue os itens. Prosseguir com o processo de contratação da segunda colocada no pregão.', 'Informar a empresa da necessidade dos materiais, estipular prazo hábil para a entrega e acompanhar os tramites de contratação.', 'Não entrega dos materiais.', 'Alto', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 27, NULL),
(25, 'Notificar a empresa fornecedora, solicitar a troca dos itens e caso a empresa não cumpra, solicitar que ela seja penalizada. Prosseguir com o processo de contratação da segunda colocada no pregão.', 'Informar a empresa da necessidade dos prazos dos materiais estarem com a validade em ordem, estipular prazo hábil para a entrega e acompanhar os tramites de contratação.', 'Entrega de materiais com prazo de validade vencido.', 'Médio', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 27, NULL),
(26, 'Notificar a empresa fornecedora e solicitar que ela seja penalizada, caso não entregue o novo produto e prosseguir com a segunda colocada no pregão.', 'Verificar com a empresa novos prazos para troca e nova entrega de materiais.', 'Entrega de produtos com defeito.', 'Alto', 'Média', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 27, NULL),
(27, 'Notificar a empresa fornecedora/ executora e solicitar que ela seja penalizada caso não entregue os itens e forneça os serviços contratados. Prosseguir com o processo de contratação da segunda colocada no pregão.', 'Informar adequadamente as empresas da necessidade dos materiais e serviços contratados, estipular prazo hábil para a entrega e execução, e acompanhar os tramites de contratação.', 'Não concretização dos serviços e materiais solicitados.', 'Alto', 'Média', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 30, NULL),
(28, 'Notificar a empresa fornecedora/ executora e solicitar que ela seja penalizada, caso não entregue o novo produto ou realize o novo serviço e prosseguir com a segunda colocada no pregão.', 'Verificar com a empresa novos prazos para troca e nova entrega de materiais e realização dos serviços prestados.', 'Inadequação ou falha nos serviços prestados.', 'Médio', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 30, NULL),
