(30, 'Notificar a empresa fornecedora/ executora e solicitar que ela seja penalizada, caso não entregue o novo produto ou realize o novo serviço e prosseguir com a segunda colocada no pregão.', 'Verificar com a empresa novos prazos para troca e nova entrega de materiais e realização dos serviços prestados.', 'Inadequação ou falha nos serviços prestados.', 'Médio', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 31, NULL),
(31, 'Notificar a empresa fornecedora/ executora e solicitar que ela seja penalizada caso não entregue os itens e forneça os serviços contratados. Prosseguir com o processo de contratação da segunda colocada no pregão.', 'Informar adequadamente as empresas da necessidade dos materiais e serviços contratados, estipular prazo hábil para a entrega e execução, e acompanhar os tramites de contratação.', 'Não concretização dos serviços e materiais solicitados.', 'Baixo', 'Baixa', 'Wechila Andrade de Brito', 'Wechila Andrade de Brito', 32, NULL),
