(386, 273809, NULL, 'Computador Desktop-Mini', '1. Processador\r\n1.1. Arquitetura x86 com suporte a 32 e 64 bits;\r\n1.2. O processador devera&#769; ter:\r\n1.2.1. Ao menos 6 (seis) nu&#769;cleos fi&#769;sicos;\r\n1.2.2. Freque&#770;ncia mi&#769;nima de 2.7Ghz e máxima de 4GHz no modo turbo;\r\n1.2.3. Cache mi&#769;nimo de 12MB, comprovado pelo fabricante;\r\n1.3. O processador devera&#769; possuir controladores de memo&#769;ria e gra&#769;fico integrado;\r\n4. Memo&#769;ria RAM\r\n4.1. Devera&#769; ser fornecido no mi&#769;nimo 08 GB de memo&#769;ria RAM por computador;\r\n4.2. Barramento de memo&#769;ria no mi&#769;nimo do tipo DDR4 2400 MHz ou superior;\r\n4.3. Permitir expansa&#771;o ate&#769; 16GB no mi&#769;nimo;\r\n4.4. Suportar tecnologia Dual Channel;\r\n\r\n5. Armazenamento\r\n5.1. Controladora de discos integrada a placa ma&#771;e, padra&#771;o SATA 3 com taxa mi&#769;nima de transfere&#770;ncia de 6.0 GB/s;\r\n5.2. Conexa&#771;o padra&#771;o SATA e indicador luminoso de atividade;\r\n5.2.1. Devera&#769; possuir um disco padra&#771;o SSD com capacidade mi&#769;nima de 240GB;\r\n2. Gabinete\r\n12.1. Padra&#771;o mini desktop que permita a utilizac&#807;a&#771;o na posic&#807;a&#771;o horizontal e vertical sem comprometer os componentes internos e o funcionamento do computador, com volume ma&#769;ximo de 1,1 Litros;\r\n12.1.1. Comprimentos lineares ma&#769;ximos de 182 x 183 x 37 mm (L x P x A);\r\n12.2. Possuir bota&#771;o liga/desliga na parte frontal;\r\n12.3. Devera&#769; possuir slot para instalac&#807;a&#771;o de cabo de seguranc&#807;a padra&#771;o Kensigton;\r\n12.4. O gabinete devera&#769; ser fabricado em chapa meta&#769;lica (u&#769;nica excec&#807;a&#771;o aceita sera&#769; a\r\nparte frontal), acabamento interno sem superfi&#769;cies cortantes;\r\n12.4.1. Na&#771;o sera&#771;o aceitos gabinetes em que parafusos tenham sido removidos para que\r\nesta especificac&#807;a&#771;o seja atendida.\r\n12.4.2. Na&#771;o sera&#771;o aceitos gabinetes em que pec&#807;as ou estruturas fiquem soltas (na&#771;o\r\ntravadas) e se mantenham em suas posic&#807;o&#771;es pela simples ac&#807;a&#771;o da gravidade ou exclusivamente pela pressa&#771;o exercida por outros componentes, como a tampa ou cabos.\r\n12.4.3. Todo e qualquer componente devera&#769; obrigatoriamente ser travado mecanicamente, permanecendo em sua posic&#807;a&#771;o, qualquer que seja a condic&#807;a&#771;o em que estiver o equipamento (com ou sem tampa e mesmo de cabec&#807;a para baixo);\r\n12.5. Devera&#769; possuir sistema de refrigerac&#807;a&#771;o dimensionado para perfeita refrigerac&#807;a&#771;o do processador e demais componentes internos ao gabinete, para garantir a temperatura de funcionamento e vida u&#769;til dos componentes, considerando a operac&#807;a&#771;o na capacidade ma&#769;xima do microprocessador em ambiente na&#771;o refrigerado;\r\n12.5.1. Na&#771;o sera&#771;o aceitos gabinetes que necessitem de entrada/sai&#769;da de ar nas faces superior e laterais, podendo usar para a referida finalidade, apenas a face frontal e/ou traseira;\r\nonitor\r\n \r\nEspecificações:\r\n \r\n-  Tela LED.\r\n-  Tamanho da tela 21,5 ?.\r\n-  Resolução FULL HD.\r\n-  Frequência mínima 60 hertz.\r\n-  Contraste 3000:1.\r\n-  Conexões HDMI e VGA.\r\n\r\n', '', 48, 'Enviado', 'Material Permanente', 'Kit', 5600, 16, 389, 32, NULL),
