(528, 440794, NULL, 'MICROSCÓPIO, TIPO DE ANÁLISE ESTEREOSCÓPIO, TIPO BINOCULAR, AUMENTO OCULARES ATÉ 10X, ZOOM ATÉ 5X', 'Estereoscópio de Bolso com corpo metálico, lente de 4 aumentos (4X) e ajuste interpupilar. Estereoscópios para a análise de pares de fotografias aéreas, já que eles fazem com que observemos as fotos tiradas de pontos de vista diferentes uma com cada olho, dando uma impressão de tridimensionalidade, permitindo, por exemplo, visualizar a diferença de relevos em uma área de vales e escarpas.', '', 15, 'Pendente', 'Material Permanente', 'Unidade', 265, NULL, 531, 31, NULL),
(529, 440794, NULL, 'MICROSCÓPIO, TIPO DE ANÁLISE ESTEREOSCÓPIO, TIPO BINOCULAR, AUMENTO OCULARES ATÉ 10X, ZOOM ATÉ 5X', 'Estereoscópio de Bolso com corpo metálico, lente de 4 aumentos (4X) e ajuste interpupilar. Estereoscópios para a análise de pares de fotografias aéreas, já que eles fazem com que observemos as fotos tiradas de pontos de vista diferentes uma com cada olho, dando uma impressão de tridimensionalidade, permitindo, por exemplo, visualizar a diferença de relevos em uma área de vales e escarpas. Um estereoscópio para suprir as necessidades básicas dos estudantes que necessitam trabalhar com fotografias aéreas.', '', 15, 'Pendente', 'Material Permanente', 'Unidade', 265, 19, 532, 31, NULL),
(530, 24341, NULL, 'bússola navegação, nome bussola de navegacao', 'Bússola tipo Clar\r\n Bússola com corpo em alumínio, clinômetro vertical em pêndulo e tipo Clar, espelho, régua lateral e tira de pulso.\r\n210º de liberdade para o clinômetro da dobradiça e 180º para o clinômetro interno.\r\n\r\nSistema de travamento da agulha controlável. Pontos fosforescentes nos quatro pontos cardeais do limbo.\r\nDeclinação e dureza da dobradiça facilmente ajustáveis com a ajuda da chave de ajuste inclusa. Bolsa para cinto em couro sintético com interior aveludado.\r\nCaracterísticas:\r\nTempo de amortecimento: 30-60s;\r\nDivisão do limbo: 1°;\r\nPrecisão do nível circular: 30\' ± 5\'/2mm;\r\nDimensões do instrumento - 77,5x66x20mm;', '', 20, 'Pendente', 'Material Permanente', 'Unidade', 605, 19, 533, 31, NULL),
(531, 38016, NULL, 'PERNEIRA, NOME PERNEIRA DE SALVAMENTO E SEGURANCA', 'Perneira de segurança, confeccionada em material sintético, costuras em solda eletrônica, sem proteção de joelho, sem orifícios laterais para ventilação, proteção 3 talas em polipropileno interligadas, com regulagem de velcro. Perneiras para assegurar a proteção contra picadas de cobras e outros animais peçonhentos. Tamanho único. Opção com fechamento em velcro. Indicada contra animais peçonhentos.', '', 20, 'Pendente', 'Material Permanente', 'Unidade', 110, 19, 534, 31, NULL),
(532, 4472, NULL, 'EQUIPAMENTO PARA SEPARACAO DE MINERIO, NOME EQUIPAMENTO PARA SEPARACAO DE MINERIO', 'Bateia de Aço Galvanizado\r\nBateia utilizada para a separação gravimétrica de minerais e metais no processo de prospecção mineral.  Os minerais dentro dela com um pouco de água e comece o processo de agitamento através de movimentos em círculo. Esse movimento irá provocar a separação dentro da cuia dos materiais minerais e metálicos. Os materiais metálicos ficam mais ao fundo da bateia, enquanto os demais ficam nas camadas mais altas da bateia. Aos poucos, vai eliminando os minerais menso densos, até que reste apenas os metálicos (pesados) no fundo da bateia.', '', 10, 'Pendente', 'Material Permanente', 'Unidade', 105, 19, 535, 31, NULL);
