(546, 150708, NULL, 'Cama elástica trampolim', 'Cama elástica trampolim: Confeccionada em tubo de aço 1010/1020; pintura epóxi na cor preta, pés removíveis que se encaixam e travam através de pinos de fixação na parte inferior do arco; Tela resistente, costurada com linha de nylon a alças de fita militar de 50 mm na parte superior contornando toda a tela; Saia de proteção confeccionada em napa preta, com sistema de fixação por elásticos embutidos nas bordas superior e inferior; Medindo 5 x 25 mm; Com 32 molas de tração fio 3.2 x 106 mm; Confeccionado em aço carbono; Com acabamento superficial zincado branco; Fixadas a tela por 16 suportes de aço trefilado de 6.0 mm zincado branco; Sapatas de PVC antiderrapantes na cor preta; Arco de reforço em aço carbono; Suporta até 150 kg .', '', 2, 'Pendente', 'Material de Consumo', 'UNIDADE', 403, 36, 549, 38, NULL),
(547, 411624, NULL, 'APLICADOR, MATERIAL POLIETILENO, USO P/ SANITIZANTE EM TETOS PARA ÚBERES, APLICAÇÃO PROCESSO DE ORDENHA, TIPO SEM RETORNO, CAPACIDADE 350', 'COPO SEM RETORNO PARA DESINFETAR TETOS (PRÉ E PÓS DIPPING)', '', 5, 'Pendente', 'Material de Consumo', 'UNIDADE', 37.64, 37, 550, 37, NULL),
