(553, 150652, NULL, 'cronômetro', 'Cronômetro Digital Profissional: Funções: Digital; Calendário do mês, dia do mês e dia da semana; Luz noturna. Cronômetro com capacidade de medição de até 24 horas com memória para 100 voltas e múltiplas cronometragens; revisão dos dados com data-hora, melhor volta e tempo médio das voltas para cada cronometragem; Início automático do cronômetro em 10 segundos, opcional (programável). Cálculo da velocidade e Controlador de Ritmo (pacer). Possui: Temporizador de contagem decrescente de 24 horas (contagem decrescente e contagem crescente ou repetição); 02 Alarmes diários com sistema Snooze (Soneca, backup de 5 Minutos); Carregue no botão MODE repetidamente para percorrer os modos: Hora, Cronômetro, Velocidade, Revisão de dados, Temporizador, Controlador de ritmo, Alarme semanal e Alarme diário. Características: Sistema de energia: Bateria; Resistência à água : 50M ou 164 pés; Material do cordão: Nylon.', '', 3, 'Pendente', 'Material de Consumo', 'UNIDADE', 101.6, 36, 556, 38, NULL),
