(556, 150652, NULL, '1 PAR de Estrutura (tabela) para basquete', '1 PAR de Estrutura para basquete; confeccionada em tubo de aço com diâmetro de 4.1/2?; Com parede de 3,76mm; Com avanço de 2,20 mts com sistema estabilizador do vidro superior na cor vermelha; Modelo fixa; Com base de fixação no solo com profundidade de 0,30 cm ou regulado de acordo com a necessidade; Rosca de 7/8? com 4 porcas fio 13; Acompanha 1 par de tabela de vidro temperado 10 mm medindo 1,80 x 1,05 mts; 10 mm de espessura com aros flexíveis e redes oficiais; Pintura em esmalte sintético na cor branca; Com aplicação de antiferrugem. COD CAT MAT: 150652.', '', 1, 'Pendente', 'Material de Consumo', 'UNIDADE', 3396.9, 36, 559, 38, NULL),
